-- ----------------------------
-- Table structure for `ServiceRoute`
-- ----------------------------
DROP TABLE IF EXISTS `ServiceRoute`;
CREATE TABLE `ServiceRoute` (
  `RouteID` varchar(26) NOT NULL DEFAULT '' COMMENT '路由ID',
  `ContractName` varchar(200) NOT NULL DEFAULT '' COMMENT '契约全名:契约接口的全名',
  `ServiceType` varchar(20) NOT NULL DEFAULT '' COMMENT '服务类型:服务名称，运维配置',
  `CallSystem` varchar(50) NOT NULL DEFAULT '' COMMENT '体系:属于什么体系，运维设置',
  `MachineNO` varchar(10) NOT NULL DEFAULT '' COMMENT '机器编号:客户端机器编号，对应keyID的NANO',
  `DataCenter` varchar(10) NOT NULL DEFAULT '' COMMENT '机房标识:KEYID组件机房标识,DTCT',
  `UniqueSign` varchar(20) NOT NULL DEFAULT '' COMMENT '程序唯一编号:被调用程序唯一编号，配置文件中配置',
  `BindingType` varchar(15) NOT NULL DEFAULT '' COMMENT '目标服务绑定类型:绑定类型，例如net.tcp',
  `ServiceIP` varchar(300) NOT NULL DEFAULT '' COMMENT '目标服务IP地址',
  `ServicePort` int(11) NOT NULL DEFAULT '0' COMMENT '目标服务端口',
  `SvcPath` varchar(200) NOT NULL DEFAULT '' COMMENT '目标服务svc相对路径:8-11组成服务调用地址',
  `IsValid` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '是否生效(0:未起效 / 1:已起效)',
  `ModifyTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间(CURRENT_TIMESTAMP)',
  `IsDelete` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '删除状态(0:未删除 / 1:已删除)',
  `IsVirtualAddress` tinyint(4) NOT NULL DEFAULT '0',
  `ProgramName` varchar(50) NOT NULL DEFAULT '',
  `RouteAddType` tinyint(4) NOT NULL COMMENT '路由添加方式，0-手动1-自动，仅生成路由属于自动，其他均为手动	',
  `IsChecked` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0:未审核\r\n1:已审核',
  `RouteStatus` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0-手动',
  `RequestIP` varchar(15) NOT NULL DEFAULT '' COMMENT '请求服务IP',
  `ResponseServiceSetID` varchar(26) NOT NULL DEFAULT '' COMMENT '被调服务集ID',
  `Remark` varchar(200) NOT NULL DEFAULT '' COMMENT '手动时必须备注理由',
  `RequestServiceSetID` varchar(26) NOT NULL DEFAULT '' COMMENT '请求服务集ID',
  PRIMARY KEY (`RouteID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='通用服务路由表:记录服务路由';

